import React, { useContext } from 'react'
import { contextData } from './Context'

export const LabelOne = () => {
    const [data]=useContext(contextData)
    return (
        <div><h1 className='lathead'>The Latest</h1>
            {data.filter((x)=>x.id>3&&x.id<9).map((e)=>{
                return(
                    <div>
                        <img src={e.image}/>
                        <h1>{e.title}</h1>
                        <p>{e.content}</p>
                        <p>{e.category}/{e.date}</p>
                    </div>
                )
            })}
        </div>
    )
}
